raw_text:
이게 공포인지 모를지경…
30프로 이상 수익이었던 주식계좌가 음전될지경인데;;; 
트럼프 제발 멈춰라

아직 상용화 단계 아니라서 떨어지는게 당연한건데 왜 엔비 핑계를 대지? 했다가
양자 얼마나 떨어졌는지 보고 온 뒤 묵념하게 됨
ㄷㄷ;

4% 반등은 인륜적 반등 아닌가요;;

오늘은 업틱룰도 발동했고요.

내일 공매도 들어오면 어찌 될지 모르겠네요.

아침에 출근이라 어쩔수없이 자러 갑니다.

일주일만에 일하는거라 가뜩이나 가기 싫은데 아침에 종가보고 빡치지나 않았음 좋겠습니다.

출근해서 열어볼건데 그 전에 5퍼하락 푸쉬알림 와있으면 쉣인데 -_-;;

도박의 경계에 잇는것같습니다.
      오늘 4천 들어왓네요ㅠ
   과연 결과는~~;;;

오늘 당장 125 복구하는 건 바라지도 않어ㅋㅋㅋ
양전이면 됏다 휴ㅋㅋ 어제 워낙 사경을 헤매갖고^^;
오래 보자 엔비야~

지금 빠지는 건 거의 코리안들 때문임ㅋㅋ
매번 똑같음.
프장 전에 빠지면 코리안들이 하락장 무서워서 튀고, 한 8시 10시 사이에 약간 상승세면, 어? 오르네? 들어가야 되나? 이러고 있음. 그때 버거들은 일어나서 "왓더, 투데이 역시 바겐 세일?" 하면서 줍줍ㅋㅋㅋㅋㅋ진짜 무한 반복의 굴레냐;;;

하아;
황선생아
양자를 조질거면 니꺼라도 좀 올려
